  [],\n\t\"num_tags\": 0,\n\t\"name\": \"marine-bird-sightings-from-aircraft-temperature-profiles-from-xbt-casts-and-other-data-from-the\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Marine bird sightings from aircraft, temperature
  profiles from XBT casts, and other data were collected from the YANKEE CLIPPER and
  other platforms from 02 December 1969 to 28 June 1977. Data were collected by the
  Fish and Wildlife Service (FWS) and the Hydrographic Office, Ministry of Defence,
  as part of the Outer Continental Shelf Environmental Assessment Program (OCSEAP).
  Data were processed by NODC to the NODC standard F033 Marine Bird Sighting, Ship/Aircraft
  Census and the Universal Bathythermograph Output formats. Full format descriptions
  are available from NODC at www.nodc.noaa.gov/. An analog file for this accession
  is available from NODC user services.nnThe F033 format contains data from field
  observations of marine birds made along ship or aircraft survey tracks. These data
  are collected to provide information on population density and distribution. Start
  and end position, date and elapsed time, speed and course, platform type and observing
  techniques are reported for each survey. Environmental information may include meteorological
  and sea surface conditions, distances to the shoreline and shelf break, ice characteristics
  within and outside each transect and surface debris, including oil slicks. Species
  data may include age, sex, color, plumage, number of individuals, direction of flight,
  behavior and food source association. Any number of species may be reported within
  one observation time span.nnThe UBT format contains temperature-depth profile data
  obtained using expendable bathythermograph (XBT) instruments. Cruise information,
  position, date and time were reported for each observation. The data record are
  comprised of pairs of temperature-depth values. The XBT data files contain temperature
  values at non-uniform depths. These depths were recorded at the minimum number of
  points (\"inflection points\") required to accurately define the temperature curve.nStandard
  XBTs can obtain profiles to depths of either 450 or 760 m.\",\n\t\"owner_org\":
